import React, { Component } from "react";
import { NavLink } from "react-router-dom";

class LogIn extends Component {
  render() {
    return (
      <div className="LogIn">
        <NavLink to="/LogIn"> LogIn</NavLink>
      </div>
    );
  }
}

export default LogIn;
